import React from "react";
import styled from "styled-components";

const Box = styled.div`
  width: 400px;
  min-width: 400px;
  height: 230px;
  background-color: #999;
  background-image: url("https://i.pinimg.com/474x/17/12/c9/1712c9ec77f883ee3f7d703e4d8f997f.jpg");
  margin: 25px;
`;

const MovieBox = () => {
  return <Box></Box>;
};

export default MovieBox;
